import React, { useState } from 'react';
// import logo from './logo.svg';
import './App.css';

//components
import Box from './view/components/Box/Box';


function App() {

  const players = [
  {id:1 , url:"https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRLuYKbKVPl4qcm0JwbtFU6hCgWo_d4M31lQg&usqp=CAU"},
  {id:2 , url:"data:image/jpeg;base64,"},
  {id:3 , url:"data:image/jpeg;base64,"},
  {id:4 , url:"data:image/jpeg;base64,"},

  ]

  const [myArray, setMyArray] = useState([])

  return (
    <div className="all-wrapper">
    <div className="message-wrapper">
      {
        players.map((player, index) =>{
          return <Box key={index} player={player} setMyArray={setMyArray} myArray={myArray} />
        })
      }
    </div>
    <div className="updated-boxes">
      {
        myArray.map((item,index)=>{
            return <img src={item.url} alt='player' key={index}></img>
        })
      }
    </div>
    </div>



  );
}



export default App;
